Ist aber niemand da, der es empfangen könnte, so sollen sie es dem Herrn geben, und es soll dem Priester gehören, mit Ausnahme des Widders, der als Versöhnungsopfer dargebracht wird, damit es ein Opfer der Sühne sei.
Auch alle Erstlinge, welche die Söhne Israels opfern, gehören dem Priester;
und alles, was ein jeder im Heiligtume opfert, und den Händen des Priesters übergibt, soll diesem gehören.
